#include <cassert>
#include <vector>
#include <iterator>
#include <iostream>
#include <algorithm>

template <typename T>
void ReverseArray(T* start, size_t size) {
    std::reverse(start, start + size);
}

int main() {
    using namespace std;

    vector<int> v = {1, 2};
    ReverseArray(v.data(), v.size());
    assert(v == (vector<int>{2, 1}));
}

