int delay_milis = 30;

void setup() {

	for (int i = 2; i <= 6; i++) {
		pinMode(i, OUTPUT);

		}

}

void loop() {

	for (int i = 2; i <= 6; i++) {
        digitalWrite(i, HIGH);
 		delay(delay_milis);
 		digitalWrite(i, LOW);
 		delay(delay_milis);

    	}

	for (int i = 6; i >= 3; i--) {
 		digitalWrite(i, HIGH);
 		delay(delay_milis);
  		digitalWrite(i, LOW);
 		delay(delay_milis);

		}

}

